CATZ（キャズ）のノウハウを結集し、さらに進化を遂げた次世代型フォグランプ『LED FOG TYPE2 for トヨタアクア/プリウスキット』。トヨタアクア/プリウスのフォグランプ標準装着車をはじめ、多くのトヨタ車種（※1）の純正フォグランプと同形状なので簡単に取り付けできます。LEDフォグランプで、エコカーに優しい省電力と、ドライバーに優しい視認性を実現します。<BR>
<BR>
■最新欧州規格ECE規格( R19-03 Class F3)取得
<BR>
LEDを光源としたECE規格(R19-03 Class F3)を取得。もちろん保安基準適合。<BR>
<BR>
■省電力・長寿命<BR>
12V6.6Wハロゲン・HIDの約1/5の省電力。HID以上の長寿命を実現。<BR>
<BR>
■装着性の向上<BR>
純正フォグランプと同形状なので、そのまま交換可能、しかも電源は純正フォグランプコネクターへ接続するだけの簡単取り付け。また、車両へ装着したままで光軸調整ができるアジャスター付き。<BR>
<BR>
■最適な視認性<BR>
専用設計のマルチリフレクターと日亜製LED素子2個を配することでフォグランプとして最適な配光パターンを実現。ハロゲンバルブとは質の違う、3000カンデラの明るさと6000Kの鋭い白色光です。<BR>
<BR>
